import React from 'react';
import { Box, Typography, Paper, Grid, Chip, Avatar } from '@mui/material';
import { styled } from '@mui/material/styles';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ColorLensIcon from '@mui/icons-material/ColorLens';

const OutfitCard = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  position: 'relative',
  overflow: 'hidden',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: '200px',
    background: 'linear-gradient(45deg, #FF6B6B, #4ECDC4)',
    opacity: 0.1,
  },
}));

const ColorChip = styled(Chip)(({ bgcolor }) => ({
  backgroundColor: bgcolor,
  color: '#fff',
  margin: '0 4px 4px 0',
}));

const BestOutfit = () => {
  const outfit = {
    title: '미니멀 오피스룩',
    description: '색각이상 친화적인 모노톤 베이스의 오피스 스타일링입니다.',
    author: '스타일리스트김',
    likes: 234,
    colors: [
      { name: '차콜 그레이', hex: '#36454F' },
      { name: '아이보리', hex: '#FFFFF0' },
      { name: '네이비', hex: '#000080' },
    ],
    colorTips: [
      '무채색 위주의 안정적인 배색',
      '고명도 차이로 구분감 확보',
      '질감 차이로 단조로움 해소',
    ],
  };

  return (
    <Box sx={{ py: 4 }}>
      <Typography variant="h4" component="h2" gutterBottom align="center" sx={{ mb: 6 }}>
        오늘의 베스트 착장
      </Typography>
      <OutfitCard elevation={3}>
        <Box sx={{ height: '200px', mb: 3, position: 'relative' }} />
        <Box sx={{ position: 'relative', zIndex: 1 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
            <Avatar sx={{ mr: 2 }}>{outfit.author[0]}</Avatar>
            <Typography variant="subtitle1">{outfit.author}</Typography>
            <Box sx={{ ml: 'auto', display: 'flex', alignItems: 'center' }}>
              <FavoriteIcon color="error" sx={{ mr: 1 }} />
              <Typography variant="subtitle1">{outfit.likes}</Typography>
            </Box>
          </Box>

          <Typography variant="h5" gutterBottom>
            {outfit.title}
          </Typography>
          <Typography variant="body1" color="text.secondary" paragraph>
            {outfit.description}
          </Typography>

          <Box sx={{ mb: 3 }}>
            <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center' }}>
              <ColorLensIcon sx={{ mr: 1 }} />
              사용된 색상
            </Typography>
            <Box sx={{ display: 'flex', flexWrap: 'wrap' }}>
              {outfit.colors.map((color, index) => (
                <ColorChip
                  key={index}
                  label={color.name}
                  bgcolor={color.hex}
                  title={`RGB: ${color.hex}`}
                />
              ))}
            </Box>
          </Box>

          <Box>
            <Typography variant="h6" gutterBottom>
              컬러 활용 팁
            </Typography>
            <Grid container spacing={2}>
              {outfit.colorTips.map((tip, index) => (
                <Grid item xs={12} key={index}>
                  <Typography variant="body2" color="text.secondary">
                    • {tip}
                  </Typography>
                </Grid>
              ))}
            </Grid>
          </Box>
        </Box>
      </OutfitCard>
    </Box>
  );
};

export default BestOutfit;
